import React, { useState } from 'react';
import { 
  Heading,
  Paragraph,
  Card,
  Box,
  Button,
  NativeSelect,
  Textfield,
  Switch
} from '@digdir/designsystemet-react';

interface ThemeColor {
  name: string;
  value: string;
}

const ThemeBuilder: React.FC = () => {
  const [colors, setColors] = useState<ThemeColor[]>([
    { name: 'primary', value: '#1E88E5' },
    { name: 'secondary', value: '#757575' },
    { name: 'success', value: '#4CAF50' },
    { name: 'warning', value: '#FF9800' },
    { name: 'error', value: '#F44336' }
  ]);

  const [darkMode, setDarkMode] = useState(false);
  const [selectedComponent, setSelectedComponent] = useState('button');

  const handleColorChange = (name: string, value: string) => {
    setColors(prev => prev.map(color => 
      color.name === name ? { ...color, value } : color
    ));
  };

  return (
    <div>
      <Heading level={1} size="xlarge" spacing>Theme Builder</Heading>
      <Paragraph spacing>
        Customize your theme using Token Studio integration. Preview components and export your theme configuration.
      </Paragraph>

      <div style={{ display: 'grid', gridTemplateColumns: '300px 1fr', gap: '2rem' }}>
        <Card>
          <Box padding="4">
            <Heading level={2} size="small" spacing>Theme Settings</Heading>

            <div style={{ marginBottom: '1rem' }}>
              <Switch 
                checked={darkMode}
                onChange={() => setDarkMode(!darkMode)}
                size="small"
              >
                Dark Mode
              </Switch>
            </div>

            <div style={{ marginBottom: '1rem' }}>
              <NativeSelect 
                label="Preview Component"
                value={selectedComponent}
                onChange={(e) => setSelectedComponent(e.target.value)}
              >
                <option value="button">Button</option>
                <option value="card">Card</option>
                <option value="input">Input</option>
                <option value="switch">Switch</option>
              </NativeSelect>
            </div>

            <Heading level={3} size="xsmall" spacing>Colors</Heading>
            {colors.map(color => (
              <div key={color.name} style={{ marginBottom: '1rem' }}>
                <Textfield
                  label={color.name.charAt(0).toUpperCase() + color.name.slice(1)}
                  value={color.value}
                  onChange={(e) => handleColorChange(color.name, e.target.value)}
                />
                <div
                  style={{
                    height: '24px',
                    backgroundColor: color.value,
                    borderRadius: '4px',
                    marginTop: '0.5rem'
                  }}
                />
              </div>
            ))}

            <Button variant="primary" style={{ width: '100%', marginTop: '1rem' }}>
              Export Theme
            </Button>
          </Box>
        </Card>

        <Card>
          <Box padding="4">
            <Heading level={2} size="small" spacing>Preview</Heading>

            <div style={{ 
              padding: '2rem',
              backgroundColor: darkMode ? '#121212' : '#ffffff',
              borderRadius: '8px',
              transition: 'background-color 0.3s'
            }}>
              {selectedComponent === 'button' && (
                <div style={{ display: 'flex', gap: '1rem' }}>
                  <Button variant="primary">Primary</Button>
                  <Button variant="secondary">Secondary</Button>
                  <Button variant="tertiary">Tertiary</Button>
                </div>
              )}
              {selectedComponent === 'card' && (
                <Card>
                  <Box padding="4">
                    <Heading level={3} size="small" spacing>Sample Card</Heading>
                    <Paragraph>This is a sample card component with your theme applied.</Paragraph>
                  </Box>
                </Card>
              )}
              {selectedComponent === 'input' && (
                <Textfield
                  label="Sample Input"
                  placeholder="Enter some text..."
                />
              )}
              {selectedComponent === 'switch' && (
                <Switch size="small">Toggle me</Switch>
              )}
            </div>
          </Box>
        </Card>
      </div>
    </div>
  );
};

export default ThemeBuilder;
